import React, { Component } from 'react';
import './style.css'

class counter extends Component {
    state = { 
        tags:["Tag1" , "Tag2" , "Tag3" , "Tag4" , "Tag5"]
     }
     renderTags(){
        if(this.state.tags.length === 0) return <p className='ms_error'>this array empaty</p>
        return <ul className='list_test_one'> {this.state.tags.map(tag=><li>{tag}</li>)} </ul>
     }
    render() { 
        return (
            <React.Fragment>
                
                {this.renderTags()}
            </React.Fragment>
        );
    }
}
 
export default counter;
